-- loop

function TIC()
	if mode=="menu" then
		menu()
	elseif mode=="complete" then
		complete()
	elseif mode=="end" then
		fend()
	else
		if tend>0 and t>=tend then
			scomplete()
			return
		end
		-- update
		if btn(4) then
			p:doaction()
		end
		dx=0
		dy=0
		if btn(2) then dx=-1
		elseif btn(3) then dx=1
		elseif btn(0) then dy=-1
		elseif btn(1) then dy=1
		end
		p:update(dx,dy)
		for i=#ps,1,-1 do
			ps[i]:update()
		end
		crowcounter=crowcounter-1
		if crowcounter<=0 then
			if #ps>0 then
				plant=ps[math.random(#ps)]
				if plant.fruit then
					crows[#crows+1]=
						Crow:new(plant.x,plant.y)
				end
			end
			crowcounter=ispeach and 30 or 50
		end
		for i=#crows,1,-1 do
			crows[i]:update()
			if crows[i]:dead() then
				table.remove(crows,i)
			end
		end
	end
		
	-- draw
	cls(4)
	if t%60==0 then
		for x=0,29 do
			for y=0,15 do
				local m=mget(x+xworld,y+yworld)
				if m==80 then mset(x+xworld,y+yworld,81)
				elseif m==81 then mset(x+xworld,y+yworld,80)
				end
			end
		end
	end
	map(xworld,yworld)
	p:draw(t)
	for i=1,#ps do
		ps[i]:draw(t)
	end
	for i=1,#scarecrows do
		scarecrows[i]:draw(t)
	end
	for i=1,#crows do
		crows[i]:draw(t)
	end
	print(text[t//400%#text+1],70,129)
	print(string.format("SCORE: %d",score),1,129)
	if bonus then
		print(bonus.text, 84, 84)
		drawbonus()
	end

	t=t+1
end

function menu()
	for i=1,#ps do
		ps[i]:update()
		ps[i]:quench(1)
	end
	if btnp(4) then
		level=level+1
		sgame()
	end
end

function complete()
	local justchecked=false
	if btnp(4) then
		if not bchecked then
			-- check for bonuses
			bchecked=true
			justchecked=true
			for i=#bonuses,1,-1 do
				b=bonuses[i]
				if b.thresh<=score then
					bonus=b
					b.func()
					table.remove(bonuses,i)
					music(2,-1,-1,false)
					break
				end
			end
		end
		if not (justchecked and bonus) then
			bonus=nil
			level=level+1
			sgame()
		end
	end
end

function fend()
	if btnp(4) then
		smenu()
	end
end

